class Submission:
    def __init__(self, submission_id, user_id, content):
        self.submission_id = submission_id
        self.user_id = user_id
        self.content = content
        self.status = "draft"
        self.validation_rules = []

    def update_validation_rules(self, rules):
        self.validation_rules = rules

    def validate(self):
        for rule in self.validation_rules:
            if not rule(self.content):
                return False
        return True

class IssueLog:
    def __init__(self):
        self.issues = []

    def log_issue(self, submission_id, issue):
        self.issues.append((submission_id, issue))

    def get_issues(self):
        return self.issues

class SubmissionManager:
    def __init__(self):
        self.submissions = {}

    def add_submission(self, submission):
        if submission.submission_id in self.submissions:
            raise ValueError("Duplicate submission detected.")
        self.submissions[submission.submission_id] = submission

    def update_publish_status(self, submission_id, status):
        if submission_id in self.submissions:
            self.submissions[submission_id].status = status
        else:
            raise ValueError("Submission not found.")

class FileValidator:
    @staticmethod
    def validate_file(file_path):
        # Simple validation logic for demonstration
        try:
            with open(file_path, 'r') as file:
                content = file.read()
                return len(content) > 0
        except Exception as e:
            return False

